import React from 'react';
import './App.css';

import GoalList from "./components/GoalList";

const App = () => {
  const courseGoals = [
    {id: "cg1", text: "Finish the course"},
    {id: "cg2", text: "Learn a lot"},
    {id: "cg3", text: "Earn money :v"}
  ];

  return (
	  <div className="course-goals">
	  	<h2>Course Goals</h2>
      <GoalList />
	  </div>
  );
}

export default App;
